  font-size: 50px;
  text-align: center;
  padding: 50px 0;
  border-bottom: 1px solid black;
`;

const Name = styled.h2`
  font: 60px;
  > p {
    font-size: 80px;
  }
`;

const Skill = styled.h2`
  font-size: 30px;
`;

const SkillContent = styled.div``;

const Code = styled.p``;
const Tool = styled.p``;
const Plofile = styled.h2``;

const About = () => {
  return (
    <Wrapper>
      <AboutTitle>About</AboutTitle>
      <Name>
        高希怜(Kou HuiRyong)
        <p>konnnitiha </p>
      </Name>

      <Skill>
        スキル
        <SkillContent>
          <Code>言語：HTML/CSS/JavaScript/jQuery/React</Code>
          <Tool>ツール：Illustrator/Photoshop</Tool>
        </SkillContent>
      </Skill>
      <Plofile>経歴</Plofile>
    </Wrapper>
  );
};

export default About;
